import React from "react";

const Firstpage = (props) => {
  return (
    <header className="header">
      <ul className="h2">
        <li className="h1">Home</li>
        <li className="h1">9th-10th</li>
        <li className="h1">11th-12th</li>
        <li className="h1">Undergraduate</li>
        <li className="h1">Study Abroad</li>
        <li className="h1">Blog</li>
      </ul>
    </header>
  );
};

export default Firstpage;
